  false,\n\t\"url\": null,\n\t\"notes\": \"This Environmental Assessment is on the
  alternatives for enhancing breeding waterfowl habitat on Halfbreed NWR.  The preferred
  alternative is Enhanced Management Alternative, which would allow complete management
  of water elevations on Halfbreed Lake by incorporation of a water level management
  structure.  It is pursuant to the National Wildlife Refuge Improvement Acts of 1966
  and 1997, as well as the objectives for Halfbreed NWR as identified in Executive
  Order No . 9167, this Environmental Assessment evaluates current management capabilities
  and identifies and implements alternative actions which most effectively achieve
  the purposes, goals and objectives of Halfbreed NWR.  This Environmental Assessment
  also contains the Finding of No Significant Impact (FONSI).\",\n\t\"owner_org\":
